package team.twww.jwgl.model;

public class Teacher {
	private String teacher_name;
	private char sex;
	private String phone_number;
	private String college_name;
	private String job_title;
	public Teacher() {
		super();
		// TODO Auto-generated constructor stub
	}
	/**
	 * @return the teacher_name
	 */
	public String getTeacher_name() {
		return teacher_name;
	}
	/**
	 * @param teacher_name the teacher_name to set
	 */
	public void setTeacher_name(String teacher_name) {
		this.teacher_name = teacher_name;
	}
	/**
	 * @return the sex
	 */
	public char getSex() {
		return sex;
	}
	/**
	 * @param sex the sex to set
	 */
	public void setSex(char sex) {
		this.sex = sex;
	}
	/**
	 * @return the phone_number
	 */
	public String getPhone_number() {
		return phone_number;
	}
	/**
	 * @param phone_number the phone_number to set
	 */
	public void setPhone_number(String phone_number) {
		this.phone_number = phone_number;
	}
	/**
	 * @return the college_name
	 */
	public String getCollege_name() {
		return college_name;
	}
	/**
	 * @param college_name the college_name to set
	 */
	public void setCollege_name(String college_name) {
		this.college_name = college_name;
	}
	/**
	 * @return the job_title
	 */
	public String getJob_title() {
		return job_title;
	}
	/**
	 * @param job_title the job_title to set
	 */
	public void setJob_title(String job_title) {
		this.job_title = job_title;
	}
	

}
